01412 bool XVARIANT::FromString(XSTRING& from, XVARIANT_TYPE from_type)
01413 {
01414   XVARIANT_TYPE _type = from_type;
01415 
01416   if(_type == XVARIANT_TYPE_UNKNOWN)
01417     {
01418       if(!from.Compare(__L("null"), true))
01419         {
01420           _type = XVARIANT_TYPE_NULL;
01421         }
01422        else
01423         {
01424           if((!from.Compare(__L("true"), true)) || (!from.Compare(__L("false"), true)) || 
01425              (!from.Compare(__L("yes"), true))  || (!from.Compare(__L("no"), true))    || 
01426              (!from.Compare(__L("si"), true)))
01427             {
01428               _type = XVARIANT_TYPE_BOOLEAN;
01429             } 
01430            else
01431             {
01432               int ndecimals = 0;
01433 
01434               if(from.IsDecimalNumber(&ndecimals))
01435                 {
01436                   if(ndecimals <= 6)
01437                     {
01438                       _type = XVARIANT_TYPE_FLOAT;
01439                     }
01440                    else
01441                     { 
01442                       _type = XVARIANT_TYPE_DOUBLE;
01443                     }
01444                 }
01445                else
01446                 { 
01447                   if(from.IsNumber())
01448                     {
01449                       _type = XVARIANT_TYPE_DOUBLEINTEGER;
01450                     }
01451                 }
01452             } 
01453         }
01454 
01455       if(_type == XVARIANT_TYPE_UNKNOWN)
01456         {
01457           _type = XVARIANT_TYPE_STRING;
01458         }
01459     }                                         
01460 
01461   if(!from.IsEmpty())
01462     {
01463       type = _type;
01464 
01465       switch(_type)
01466         {
01467           case XVARIANT_TYPE_NULL             : break;      
01468       
01469           case XVARIANT_TYPE_BOOLEAN          : (*this) = from.ConvertToBoolean();                                                                      
01470                                                 size = sizeof(bool);    
01471                                                 break;
01472       
01473           case XVARIANT_TYPE_SHORT            : (*this) = (short)from.ConvertToInt();
01474                                                 size = sizeof(short);    
01475                                                 break;
01476 
01477           case XVARIANT_TYPE_WORD             : (*this) = (XWORD)from.ConvertToInt();                   
01478                                                 size = sizeof(XWORD);    
01479                                                 break;
01480 
01481           case XVARIANT_TYPE_INTEGER          : (*this) = from.ConvertToInt();                          
01482                                                 size = sizeof(int);    
01483                                                 break;
01484                                                 
01485           case XVARIANT_TYPE_DWORD            : (*this) = from.ConvertToDWord();                        
01486                                                 size = sizeof(XDWORD);    
01487                                                 break;
01488                                                 
01489           case XVARIANT_TYPE_DOUBLEINTEGER    : (*this) = from.ConvertToLongLong();                     
01490                                                 size = sizeof(long long);    
01491                                                 break;
01492                                                 
01493           case XVARIANT_TYPE_QWORD            : (*this) = from.ConvertToQWord();                                                                        
01494                                                 size = sizeof(XQWORD);                                                    
01495                                                 break;      
01496           
01497 
01498           case XVARIANT_TYPE_FLOAT            : (*this) = from.ConvertToFloat();                                                                        
01499                                                 size = sizeof(float);                                                   
01500                                                 break;      
01501 
01502           case XVARIANT_TYPE_DOUBLE           : (*this) = from.ConvertToDouble();                       
01503                                                 type = _type;
01504                                                 size = sizeof(double);    
01505                                                 break;
01506 
01507 
01508           case XVARIANT_TYPE_CHAR             : (*this) = (char)from.Get()[0];                         
01509                                                 
01510                                                 size = sizeof(char);                                                    
01511                                                 break;
01512 
01513           case XVARIANT_TYPE_XCHAR            : (*this) = (XCHAR)from.Get()[0];                        
01514                                                 size = sizeof(XCHAR);
01515                                                 break;
01516 
01517           case XVARIANT_TYPE_STRING           : { XSTRING* string = new XSTRING();
01518                                                   if(string)
01519                                                     {    
01520                                                       string->Set(from.Get());
01521                                                       
01522                                                       if(data)
01523                                                         {
01524                                                           Destroy();
01525                                                         }    
01526 
01527                                                       size = sizeof(XSTRING);
01528                                                       data = (void*)(string);
01529                                                     }
01530                                                 }
01531                                                 break;
01532 
01533           case XVARIANT_TYPE_TIME             : { XDATETIME* datetime = GEN_XFACTORY.CreateDateTime();
01534                                                   if(datetime) 
01535                                                     {
01536                                                       datetime->GetDateTimeFromStringISO8601(from,  XDATETIME_FORMAT_ADDTIME               | 
01537                                                                                                     XDATETIME_FORMAT_TIMEWITHSECONDS       |
01538                                                                                                     XDATETIME_FORMAT_TIMEWITHMILLISECONDS  |
01539                                                                                                     XDATETIME_FORMAT_ISO8601_ADDHOUROFFSET);                                                                                             
01540                                                       if(data)
01541                                                         {
01542                                                           Destroy();
01543                                                         }    
01544 
01545                                                       size = sizeof(XDATETIME);
01546                                                       data = (void*)(datetime);       
01547                                                     }
01548                                                 }                                            
01549                                                 break;
01550 
01551           case XVARIANT_TYPE_DATE             : { XDATETIME* datetime = GEN_XFACTORY.CreateDateTime();
01552                                                   if(datetime) 
01553                                                     {
01554                                                       datetime->CopyFrom(((XDATETIME*)this->data));      
01555 
01556                                                       datetime->GetDateTimeFromStringISO8601(from, 0);  
01557 
01558                                                       if(data)
01559                                                         {
01560                                                           Destroy();
01561                                                         }    
01562 
01563                                                       size = sizeof(XDATETIME);
01564                                                       data = (void*)(datetime);       
01565                                                     }
01566                                                 }
01567                                                 break;
01568     
01569           case XVARIANT_TYPE_DATETIME         : { XDATETIME* datetime = GEN_XFACTORY.CreateDateTime();
01570                                                   if(datetime) 
01571                                                     {                                                      
01572                                                       datetime->GetDateTimeFromStringISO8601(from, XDATETIME_FORMAT_ISO8601_STANDARD      |
01573                                                                                                    XDATETIME_FORMAT_TIMEWITHSECONDS       |
01574                                                                                                    XDATETIME_FORMAT_TIMEWITHMILLISECONDS  |
01575                                                                                                    XDATETIME_FORMAT_ISO8601_ADDHOUROFFSET);                                                                                         
01576                                                       if(data)
01577                                                         {
01578                                                           Destroy();
01579                                                         }    
01580 
01581                                                       size = sizeof(XDATETIME);
01582                                                       data = (void*)(datetime);       
01583                                                     }
01584                                                 }
01585                                                 break;
01586 
01587           case XVARIANT_TYPE_BUFFER           : { XBUFFER* buffer = new XBUFFER();
01588                                                   if(buffer)
01589                                                     {                                                      
01590                                                       buffer->ConvertFromBase64(from);
01591 
01592                                                       if(data)
01593                                                         {
01594                                                           Destroy();
01595                                                         }    
01596 
01597                                                       size = sizeof(XBUFFER);
01598                                                       data = (void*)(buffer);                                                       
01599                                                     }                                                                                                                                                        
01600                                                 }                                                                                                                                                                     
01601                                                 break;
01602                                                                 
01603           case XVARIANT_TYPE_POINTER          : from.UnFormat(__L("[%08X]"), this->data);                                                                                                                    
01604                                                 size = sizeof(void*);
01605                                                 break;      
01606 
01607                             default           : return false;
01608         }
01609     }
01610 
01611   return true;
01612 }
