01629 
01639 bool XVARIANT::Destroy()
01640 {
01641   if(data)
01642     {
01643       switch(this->type)
01644         { 
01645           case XVARIANT_TYPE_NULL           : break;
01646 
01647           case XVARIANT_TYPE_BOOLEAN        : delete (bool*)data;           break;
01648 
01649           case XVARIANT_TYPE_SHORT          : delete (short*)data;          break;
01650           case XVARIANT_TYPE_WORD           : delete (XWORD*)data;          break;          
01651           case XVARIANT_TYPE_INTEGER        : delete (int*)data;            break;
01652           case XVARIANT_TYPE_DWORD          : delete (XDWORD*)data;         break;          
01653           case XVARIANT_TYPE_DOUBLEINTEGER  : delete (long long*)data;      break;
01654           case XVARIANT_TYPE_QWORD          : delete (XQWORD*)data;         break;
01655 
01656           case XVARIANT_TYPE_FLOAT          : delete (float*)(data);        break;
01657           case XVARIANT_TYPE_DOUBLE         : delete (double*)(data);       break;
01658 
01659           case XVARIANT_TYPE_CHAR           : delete (char*)(data);         break;
01660           case XVARIANT_TYPE_XCHAR          : delete (XCHAR*)(data);        break;          
01661 
01662           case XVARIANT_TYPE_STRING         : { XSTRING* string = (XSTRING*)data;
01663                                                 delete string;      
01664                                               }
01665                                               break;      
01666 
01667           case XVARIANT_TYPE_DATE           :
01668           case XVARIANT_TYPE_TIME           :
01669           case XVARIANT_TYPE_DATETIME       : { XDATETIME* datetime = (XDATETIME*)data;    
01670                                                 delete datetime;  
01671                                               }
01672                                               break;
01673 
01674           case XVARIANT_TYPE_BUFFER         : { XBUFFER* buffer = (XBUFFER*)data;
01675                                                 delete buffer;      
01676                                               }
01677                                               break;
01678 
01679           case XVARIANT_TYPE_POINTER        : delete (XBYTE*)(data);         break;           
01680 
01681                                   default   : break;
01682         }
01683     }
01684 
01685   type    = XVARIANT_TYPE_NULL;
01686   size    = 0;
01687   data    = NULL;
01688 
01689   return true;
01690 }
